import { SettingDecoratorConverterBase } from 'src/app/_base/decorators/setting/setting.decorator.converter';
export class DataSetsSettingDecoratorConverter extends SettingDecoratorConverterBase {
  mapForNgModel(content) {
    console.log("map for ng model");
    return content?.map(x => ({
      id: x.id,
      name: x.name,
      datasets: x.datasets.join('\n')
    }));
  }
  mapForStore(content) {
    return content?.map(x => ({
      id: x.id,
      name: x.name,
      datasets: x.datasets.trim().split('\n').map(x => x.trim())
    }));
  }
}
